// TagList.js
import React from "react";

export const TagList = ({ tags }) => {
  return (
    <div>
      <h3>Tags</h3>
      <ul>
        {tags.map((tag, index) => (
          <li key={index}>{tag}</li>
        ))}
      </ul>
    </div>
  );
};
